import { Injectable } from '@angular/core';
import { ComplicationAVC } from '../models/ComplicationAVC';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AvcService {

  private apiUrl = 'https://localhost:7129/api/ComplicationAvcs';

  constructor(private http: HttpClient) { }
  addavc(ComplicationAVC: ComplicationAVC): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationAVC);

    return this.http.post<any>(`${this.apiUrl}/addavc`, ComplicationAVC, { observe: 'response' });
  }
  getById(patientId: number): Observable<any> {
    return this.http.get<any>(`${this.apiUrl}/${patientId}`);
  }

update(patientID: number, complication: ComplicationAVC): Observable<any> {
  const url = `https://localhost:7129/api/ComplicationAvcs/update/${patientID}`;
  return this.http.put(url, complication, {
    headers: new HttpHeaders({
      'Content-Type': 'application/json'
    })
  });
}}
